// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';
// import './Header.css';

const Header = () => {
  return (
    <header>
      <nav>
        <ul>
          <li>Home</li>
          <li>Create Event</li>
          <li>Manage Attendees</li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
